description:
stuntkid, an artist whose work i admire, made a tumblr logo, and i, a rabid fangirl of his work, set off to find out how to put that logo in my tumblr dash for good. 
i did it, and now jason levesque's tumblr logo will be mine forever.

{if any comments/suggestions, my tumblr is iliacrest.tumblr.com}

css:
#logo {height: 0 !important;
        width: 0 !important;
	padding-left: 248px !important;
	padding-top: 56px !important;
	background: url(http://i.imgur.com/OSEoG.png) no-repeat !important;}

@-moz-document domain('www.tumblr.com'), url-prefix('http://www.tumblr.com/edit/'), url-prefix('http://www.tumblr.com/new/'), url-prefix('http://www.tumblr.com/directory/'), url-prefix('http://www.tumblr.com/reblog/'), url-prefix('http://www.tumblr.com/'), url-prefix("https://www.tumblr.com/edit/"), url-prefix("https://www.tumblr.com/new/"), url-prefix("https://www.tumblr.com/directory/"), url-prefix("https://www.tumblr.com/reblog/"), url-prefix("https://www.tumblr.com/") {
	/* 
		the code in here only applies to:
			-pages on the domain www.tumblr.com
			-pages whose URLs start with http://www.tumblr.com/
                        -pages whose URLs start with http://www.tumblr.com/edit/
                        -pages whose URLs start with http://www.tumblr.com/new/
                        -pages whose URLs start with http://www.tumblr.com/directory/
                        -pages whose URLs start with http://www.tumblr.com/reblog/


	*/
}
